import React, { useEffect } from "react";
import { Link, NavLink } from "react-router-dom";
import pic from "../images/usersettings.jpg";

function UserSettings() {
  useEffect(() => {
    return () => {};
  }, []);

  return (
    <div
      style={{
        position: "absolute",
        width: "100vw",
        height: "100vh",
        overflow: "hidden",
      }}
    >
      <div
        style={{
          position: "absolute",
          width: "100vw",
          height: "100vh",
          backgroundImage: `url(${pic})`,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          zIndex: -1,
        }}
      />
      {/* Black overlay for bg
      <div
        style={{
          position: "absolute",
          width: "100%",
          height: "100%",
          backgroundColor: "rgba(0, 0, 0, 0.5)"
          zIndex: 0,
        }}
      /> */}

      {/* Settings */}
      <div
        style={{
          position: "fixed",
          top: "10vh",
          left: "20vh",
          width: "100vw",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
          textAlign: "center",
          padding: "2vh",
          boxSizing: "border-box",
          zIndex: 1, // Ensure it's above the overlay
        }}
      >
        {/* Edit width of box here */}
        <p
          style={{
            color: "#ffffff",
            width: "60vw",
            border: "2px solid rgba(255, 217, 0, 0.7)",
            backgroundColor: "rgba(0, 0, 38, 0.7)",
            borderRadius: "5px",
            padding: "2vh",
            textAlign: "center",
            fontSize: "3vh",
          }}
        >
          User Information
        </p>
      </div>
    </div>
  );
}

export default UserSettings;
